import Vue from 'vue';
import Vuetify from 'vuetify/lib/framework';
import api from "../services/api"

Vue.use(Vuetify);
Vue.use(require('vue-moment'))
Vue.use(require('vue-sorted-table'))
Vue.prototype.$http = api;

export default new Vuetify({
});
